{"query":"query getSpecificGauges($gauges: [String]) {
  gauges(where: {id_in: $gauges}, orderBy: created, orderDirection: desc) {
    id
    address
    created
    type {
      id
      __typename
    }
    weights(first: 1, orderBy: time, orderDirection: desc) {
      id
      time
      weight
      __typename
    }
    __typename
  }
}","operationName":"getSpecificGauges","variables":{"gauges":["0xbcbcf05f2f77e2c223334368162d88f5d6032699","0xf57882cf186db61691873d33e3511a40c3c7e4da"]}}

{"query":"query getAllGauges($gauges: [String]) {
  gauges(
    where: {type: "1", id_in: $gauges, market_: {id_not: "null"}}
    orderBy: created
    orderDirection: desc
  ) {
    id
    address
    created
    type {
      id
      __typename
    }
    market {
      ...MarketFragment
      __typename
    }
    weights(first: 1, orderBy: time, orderDirection: desc) {
      id
      time
      weight
      __typename
    }
    __typename
  }
}

fragment MarketFragment on Market {
